from typing import List


class Solution:
    def sequenceReconstruction(self, nums: List[int], sequences: List[List[int]]) -> bool:
        g = dict()
        degree = dict()
        for items in sequences:
            u = items[0]
            if len(items) == 1:
                degree.setdefault(u, 0)
            for v in items[1:]:
                g.setdefault(u, {})
                g[u].setdefault(v, 0)
                g[u][v] += 1
                degree.setdefault(u, 0)
                degree.setdefault(v, 0)
                degree[v] += 1
                u = v

        zero = set()
        for k, v in degree.items():
            if v == 0:
                zero.add(k)

        for u in zero:
            degree.pop(u)

        if len(zero) > 1:
            return False

        for num in nums:
            if num not in zero:
                return False
            zero.remove(num)

            for v, val in g.get(num, {}).items():
                if val <= 0:
                    continue
                g[num][v] = 0
                degree[v] -= val

                if degree[v] == 0:
                    zero.add(v)
                    degree.pop(v)

            if len(zero) > 1:
                return False

        if len(zero) == 0:
            return True

        return False



